  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  and Izembek NWRs outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, mammals, and fish- is also covered.
  Resource management is outlined; topics include grazing and fur harvesting. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest and N-R
  forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
